import React from "react";
import "./Blog.css";
import Image1 from "../../assests/avatar-1.svg";
import Image2 from "../../assests/avatar-3.svg";
import Image3 from "../../assests/avatar-3.svg";

const Blog = () => {
  return (
    <section className="blog container" id="blog">
      <h2 className="section__title">Latest Posts</h2>;
      <div className="blog__container grid">
        <div className="blog__card">
          <div className="blog__thumb">
            <a href="#">
              {" "}
              <span className="blog__category"></span>
            </a>
            <a href="#">
              <img src="" alt="" className="blog__img" />
            </a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Blog;
